script: |
  super -f text -I q1620.spq | sort > q1620.out

inputs:
  - name: q1620.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN + - ( - col2 ) * - col1 * CAST ( col2 AS INTEGER ) / + - col0 + + - col2 AND NULL;
  - name: tab1

outputs:
  - name: q1620.out
    data: |
